import React from 'react';

const Result=(props)=>{
  return(
<div>
        <ul className="weatherList">
        <li>Area Name: {props.name}</li>
            <li>Country             : {this.props.country}</li>
            <li>Temparature         : {this.props.temp}°C</li>
            <li>Min temperature     : {this.props.min}°C</li>
            <li>Max temperature     : {this.props.max}°C</li>
            <li>Weather             : {this.props.weather}</li>
            <li>Clouds              : {this.props.clouds}</li>
            <li>Wind Speed          : {this.props.wind}</li>
        </ul>
    </div>
  )  
}

export default Result;
